import React from "react";
import Home from "./pages/Home";
import {Router} from "express";

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Navigate to="/home" />} />
                <Route path="/home" element={<Home />} />
            </Routes>
        </Router>
    )
}

export default App;
